interface PipelineStage {
  name: string;
  count: number;
  total: number;
  status: 'complete' | 'in-progress' | 'pending';
}

interface PipelineProgressProps {
  stages: PipelineStage[];
}

/**
 * Visual pipeline progress component showing 4 stages:
 * Discover -> Collect -> Analyze -> Generate
 *
 * Color coding:
 * - Green for complete (100%)
 * - Yellow for in-progress (partially complete)
 * - Gray for pending (0%)
 */
export function PipelineProgress({ stages }: PipelineProgressProps) {
  const getStatusColor = (status: PipelineStage['status']) => {
    switch (status) {
      case 'complete':
        return 'bg-green-500';
      case 'in-progress':
        return 'bg-yellow-500';
      case 'pending':
        return 'bg-[var(--muted)]';
    }
  };

  const getStatusBorderColor = (status: PipelineStage['status']) => {
    switch (status) {
      case 'complete':
        return 'border-green-500';
      case 'in-progress':
        return 'border-yellow-500';
      case 'pending':
        return 'border-[var(--muted)]';
    }
  };

  const getPercentage = (count: number, total: number) => {
    if (total === 0) return 0;
    return Math.round((count / total) * 100);
  };

  return (
    <div className="rounded-xl bg-[var(--card)] border border-[var(--border)] p-6">
      <h3 className="text-lg font-semibold text-[var(--foreground)] mb-6">Pipeline Health</h3>

      <div className="flex items-center justify-between">
        {stages.map((stage, index) => {
          const percentage = getPercentage(stage.count, stage.total);

          return (
            <div key={stage.name} className="flex items-center">
              {/* Stage Circle */}
              <div className="flex flex-col items-center">
                <div
                  className={`flex h-16 w-16 items-center justify-center rounded-full border-4 ${getStatusBorderColor(stage.status)} bg-[var(--secondary)]`}
                >
                  <span className="text-lg font-bold text-[var(--foreground)]">
                    {percentage}%
                  </span>
                </div>
                <p className="mt-3 text-sm font-medium text-[var(--foreground)]">{stage.name}</p>
                <p className="text-xs text-[var(--muted-foreground)]">
                  {stage.count} / {stage.total}
                </p>
              </div>

              {/* Connector Line */}
              {index < stages.length - 1 && (
                <div className="mx-4 flex-1">
                  <div className="relative h-1 w-16 bg-[var(--secondary)] rounded-full overflow-hidden">
                    <div
                      className={`absolute left-0 top-0 h-full ${getStatusColor(stage.status)} rounded-full transition-all duration-500`}
                      style={{ width: `${percentage}%` }}
                    />
                  </div>
                </div>
              )}
            </div>
          );
        })}
      </div>

      {/* Progress Bar */}
      <div className="mt-8">
        <div className="flex justify-between text-sm mb-2">
          <span className="text-[var(--muted-foreground)]">Overall Progress</span>
          <span className="text-[var(--foreground)] font-medium">
            {getPercentage(
              stages.reduce((sum, s) => sum + s.count, 0),
              stages.reduce((sum, s) => sum + s.total, 0)
            )}%
          </span>
        </div>
        <div className="h-2 w-full bg-[var(--secondary)] rounded-full overflow-hidden">
          <div
            className="h-full bg-gradient-to-r from-green-500 via-yellow-500 to-blue-500 rounded-full transition-all duration-500"
            style={{
              width: `${getPercentage(
                stages.reduce((sum, s) => sum + s.count, 0),
                stages.reduce((sum, s) => sum + s.total, 0)
              )}%`,
            }}
          />
        </div>
      </div>
    </div>
  );
}

