export async function getReviewDistribution(
  contractorId: string
): Promise<Record<number, number>> {
  const supabase = await createClient();

  const { data, error } = await supabase
    .from('review_data')
    .select('rating')
    .eq('contractor_id', contractorId);

  if (error) {
