export interface ReviewFilters {
  rating?: number;
  search?: string;
  hasOwnerResponse?: boolean;
}

export interface ReviewWithContractor {
  id: string;
  contractor_id: string;
  reviewer_name: string | null;
  rating: number;
  review_text: string | null;
  review_date: string | null;
  owner_response: string | null;
  review_url: string | null;
  collected_at: string;
  contractor: {
    id: string;
    business_name: string;
    city: string | null;
    state: string | null;
  } | null;
}

/**
 * Get all reviews with optional filters and pagination
 * For the /reviews browser page
 *
 * @param filters - Optional filter criteria
 * @param page - Page number (1-indexed)
 * @param limit - Items per page
 * @returns Paginated reviews with contractor data
 */
export async function getReviews(
  filters?: ReviewFilters,
  page = 1,
  limit = 20
): Promise<{ data: ReviewWithContractor[]; total: number; stats: { avgRating: number; responseRate: number } }> {
  const supabase = await createClient();

  const from = (page - 1) * limit;
  const to = from + limit - 1;

  let query = supabase
    .from('review_data')
    .select(
      `
      *,
      contractor:review_contractors(id, business_name, city, state)
    `,
      { count: 'exact' }
    );

  // Apply filters
  if (filters?.rating) {
    query = query.eq('rating', filters.rating);
  }
  if (filters?.search) {
    query = query.or(`review_text.ilike.%${filters.search}%,reviewer_name.ilike.%${filters.search}%`);
  }
  if (filters?.hasOwnerResponse !== undefined) {
    if (filters.hasOwnerResponse) {
      query = query.not('owner_response', 'is', null);
    } else {
      query = query.is('owner_response', null);
    }
  }

  query = query
    .range(from, to)
    .order('review_date', { ascending: false, nullsFirst: false });

  const { data, count, error } = await query;

  if (error) {
    console.error('Error fetching reviews:', error);
    throw error;
  }

  // Calculate stats from a separate query (for all reviews, not just current page)
  const statsQuery = await supabase
    .from('review_data')
    .select('rating, owner_response');

  const allReviews = statsQuery.data || [];
  const totalReviews = allReviews.length;
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  const sumRatings = allReviews.reduce((sum: number, r: any) => sum + (r.rating || 0), 0);
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  const withResponse = allReviews.filter((r: any) => r.owner_response).length;

  const reviews = (data || []) as ReviewWithContractor[];

  return {
    data: reviews,
    total: count || 0,
    stats: {
      avgRating: totalReviews > 0 ? sumRatings / totalReviews : 0,
      responseRate: totalReviews > 0 ? (withResponse / totalReviews) * 100 : 0,
    },
  };
}

