/**
 * Generate page numbers to display in pagination
 */
function getPageNumbers(currentPage: number, totalPages: number): (number | 'ellipsis')[] {
  const pages: (number | 'ellipsis')[] = [];

  if (totalPages <= 7) {
    for (let i = 1; i <= totalPages; i++) {
      pages.push(i);
    }
  } else {
    pages.push(1);

    if (currentPage > 3) {
      pages.push('ellipsis');
    }

    const start = Math.max(2, currentPage - 1);
    const end = Math.min(totalPages - 1, currentPage + 1);

    for (let i = start; i <= end; i++) {
      pages.push(i);
    }

    if (currentPage < totalPages - 2) {
      pages.push('ellipsis');
    }

    if (totalPages > 1) {
      pages.push(totalPages);
    }
  }

  return pages;
}

/**
 * Pagination component for navigating through article pages.
 * Uses Next.js Link for navigation with preserved filter params.
 */
function Pagination({
  currentPage,
  totalPages,
  totalCount,
  currentParams,
}: {
  currentPage: number;
  totalPages: number;
  totalCount: number;
  currentParams: Record<string, string | undefined>;
}) {
  const itemsPerPage = 10;
  const startItem = totalCount === 0 ? 0 : (currentPage - 1) * itemsPerPage + 1;
  const endItem = Math.min(currentPage * itemsPerPage, totalCount);
  const pageNumbers = getPageNumbers(currentPage, totalPages);

  // Build params without page for link building
  const baseParams = { ...currentParams };
  delete baseParams.page;

  return (
    <div className="flex flex-col gap-4 sm:flex-row sm:items-center sm:justify-between">
      {/* Results count */}
      <p className="text-sm text-[var(--muted-foreground)]">
        Showing <span className="font-medium text-[var(--foreground)]">{startItem}</span> to{' '}
        <span className="font-medium text-[var(--foreground)]">{endItem}</span> of{' '}
        <span className="font-medium text-[var(--foreground)]">{totalCount}</span> articles
      </p>

      {/* Page navigation */}
      <div className="flex items-center gap-2">
        {currentPage === 1 ? (
          <Button variant="secondary" size="sm" disabled>
            <ChevronLeft className="h-4 w-4" />
            Previous
          </Button>
        ) : (
          <Button variant="secondary" size="sm" asChild>
            <Link href={`/articles${buildQueryString(baseParams, { page: String(currentPage - 1) })}`}>
              <ChevronLeft className="h-4 w-4" />
              Previous
            </Link>
          </Button>
        )}

        {/* Page numbers */}
        <div className="hidden sm:flex items-center gap-1">
          {pageNumbers.map((page, index) => {
            if (page === 'ellipsis') {
              return (
                <span key={`ellipsis-${index}`} className="px-2 text-[var(--muted-foreground)]">
                  ...
                </span>
              );
            }

            const isCurrentPage = page === currentPage;

            if (isCurrentPage) {
              return (
                <Button
                  key={page}
                  size="icon-sm"
                  className="h-9 w-9"
                >
                  {page}
                </Button>
              );
            }

            return (
              <Button
                key={page}
                variant="secondary"
                size="icon-sm"
                className="h-9 w-9"
                asChild
              >
                <Link href={`/articles${buildQueryString(baseParams, { page: String(page) })}`}>
                  {page}
                </Link>
              </Button>
            );
          })}
        </div>

        {/* Current page indicator (mobile) */}
        <span className="sm:hidden text-sm text-[var(--muted-foreground)]">
          Page {currentPage} of {totalPages}
        </span>

        {currentPage === totalPages || totalPages === 0 ? (
          <Button variant="secondary" size="sm" disabled>
            Next
            <ChevronRight className="h-4 w-4" />
          </Button>
        ) : (
          <Button variant="secondary" size="sm" asChild>
            <Link href={`/articles${buildQueryString(baseParams, { page: String(currentPage + 1) })}`}>
              Next
              <ChevronRight className="h-4 w-4" />
            </Link>
          </Button>
        )}
      </div>
    </div>
  );
}

