        if (line.startsWith('### ')) {
          return (
            <h3
              key={index}
              className="text-lg font-semibold text-foreground mt-4 mb-2"
            >
              {line.replace('### ', '')}
            </h3>
          )
        }
        // Lists
        if (line.startsWith('- ')) {
          return (
            <li key={index} className="text-foreground ml-4 list-disc">
              {line.replace('- ', '').replace(/\*\*(.*?)\*\*/g, '$1')}
            </li>
          )
        }
        // Italics (for notes)
        if (line.startsWith('*') && line.endsWith('*') && !line.startsWith('**')) {
          return (
            <p key={index} className="text-sm text-muted-foreground italic mt-4">
              {line.replace(/^\*/, '').replace(/\*$/, '')}
            </p>
          )
        }
        // Empty lines
        if (line.trim() === '') {
          return <div key={index} className="h-2" />
        }
        // Regular paragraphs (with bold text support)
        return (
          <p key={index} className="text-foreground leading-relaxed mb-3">
            {line.split(/(\*\*.*?\*\*)/).map((part, i) => {
              if (part.startsWith('**') && part.endsWith('**')) {
                return (
