export function ContractorFilters({ cities, states }: ContractorFiltersProps) {
    const router = useRouter();
    const searchParams = useSearchParams();
    const pathname = usePathname();
    const [isPending, startTransition] = useTransition();

    // Local state for immediate UI updates
    const [search, setSearch] = useState(searchParams.get('search') || '');
    const [debouncedSearch] = useDebounce(search, 300);

    // Sync search with URL when URL changes explicitly (e.g. back button)
    useEffect(() => {
        setSearch(searchParams.get('search') || '');
    }, [searchParams]);

    // Handle URL updates
    const updateFilters = useCallback(
        (key: string, value: string | null) => {
            const params = new URLSearchParams(searchParams.toString());

            // Reset page when filtering
            params.delete('page');

            if (value) {
                params.set(key, value);
            } else {
                params.delete(key);
            }

            startTransition(() => {
                router.replace(`${pathname}?${params.toString()}`, { scroll: false });
            });
        },
        [searchParams, pathname, router]
    );

    // Effect for debounced search
    useEffect(() => {
        const currentSearch = searchParams.get('search') || '';
        if (debouncedSearch !== currentSearch) {
            updateFilters('search', debouncedSearch || null);
        }
    }, [debouncedSearch, updateFilters, searchParams]);

    const currentMinRating = searchParams.get('minRating');

    // Pipeline status helper
