                            onValueChange={(val) => updateFilters('city', val === 'all' ? null : val)}
                        >
                            <SelectTrigger className="h-10 w-[140px] px-3 rounded-xl border-white/5 bg-black/20 text-sm font-medium hover:bg-black/30 transition-colors focus:ring-0">
                                <div className="flex items-center gap-2 truncate">
