      status: 200,
      headers: {
        'Content-Type': 'application/json',
        'Content-Disposition': `attachment; filename="${filename}"`,
      },
    })
  } catch (error) {
    console.error(`Failed to read export file ${filename}:`, error)
    return NextResponse.json(
      { error: 'Export file not found' },
